import logo from './logo.svg';
import './App.css';
import Scorecard from './Scorecard'

function App() {
  return (
    <div>
      <div className="App">This is my first little div</div>
      <Scorecard
          Team1 = "Swans"
          Team2 = "Eagles"
      />
    </div>
  );
}

export default App;
